import {
  deleteTodo,
  getAllTodos,
  getOneTodo,
  insertTodo,
  updateOneTodo,
  deleteAllTodos,
} from "../../api/api";
import React, { useState, useEffect } from "react";
import "./todo.css";
import { Input, TableCell } from "@mui/material";
import {
  Button,
  Card,
  Col,
  Container,
  Navbar,
  Row,
  button,
} from "react-bootstrap";

// const [todo, settodo] = useState();
