// const [deleteTodoID, setdeleteTodoID] = useState(0);
// const [todoTask, settodoTask] = useState("");
// const [isDeleteAll, setIsDeleteAll] = useState(false);
function AllTodo(props) {
  const [todos, settodos] = useState([]);

  useEffect(() => {
    const getAll = async () => {
      let result = await getAllTodos();
      if (result.length > 0) {
        settodos(result);
      }
    };
    getAll();
    console.log("calls made 33 ", {
      // isGetAll,
      // isDeleted,
      // isInserted,
      // isDeleteAll,
    });
  }, []);
  // isGetAll, isDeleted, isInserted, isDeleteAll
  return (
    <>
      <Navbar bg="dark" expand="sm" variant="dark">
        <Container fluid>
          <Navbar.Brand className="mx-auto">React TodoList</Navbar.Brand>
        </Container>
      </Navbar>
      <Container className="mt-3">
        <Row>
          <Col xs={4}>
            <Card className="shadow-lg">
              <Card.Body className="mx-auto">
                <div style={{ali}}>
                  <div>
                    <p1>ID</p1>
                    {todos.map((item) => (
                      <p>{item.id}</p>
                    ))}
                  </div>
                  <div>
                    <p1>TASK</p1>
                    {todos.map((item) => (
                      <p>{item.task}</p>
                    ))}
                  </div>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>

      {/* <Row>
          <Col xs={4}>TASK</Col>
          <Col xs={4}>
            {todos.map((item) => (
              <tfoot textAlign="left" key={item.id}>
                <tr>
                  {item.task}
                </tr>
              </tfoot>
            ))}
          </Col>
        </Row> */}
      {/* </Container> */}
    </>
  );
}
export default AllTodo;
